LAHORE, Mar 01 (APP): Punjab Chief Minister Sardar Usman Buzdar on Monday condoled the death of veteran actor Ejaz Durrani and extended sympathies to the bereaved family.
In a condolence message, the Chief Minister paid tribute to the services of late Ejaz Durrani and said that he was a valuable asset of the film industry whose artistic services could not be forgotten.
